[XX,YY] = meshgrid(x,y);

%% converting Z into a square matrix
[rows,columns]=size(XX);
M = zeros(rows);
 for i=1:rows
     for j=1:columns
         M(i,j) = z(j);
     end
 end

%% plotting a trimesh graph
figure;
T = delaunay(x,y);
% x and y are coordinates and z is best rsrp value
trimesh(T,x,y,z); 


%% plotting wide beam distribution in simulation area using color coding

widebeamindex = RsrpBestWideBeamLog(:,4);

figure;
set(gcf,'color','w');
% xcoordinates = AngleDistCord(:,7);
% ycoordinates = AngleDistCord(:,8);

xcoordinates = CoordDistAngleIslosLog(:,7);
ycoordinates = CoordDistAngleIslosLog(:,8);

%xcoordinates = RsrpNarrowBeamSVM(:,7);
%ycoordinates = RsrpNarrowBeamSVM(:,8);
for i=1:20000
    if(widebeamindex(i)==1)
        scatter(xcoordinates(i),ycoordinates(i),'.k')
        hold on;
    elseif(widebeamindex(i)==2)
        scatter(xcoordinates(i),ycoordinates(i),'.b')
        hold on;
    elseif(widebeamindex(i)==3)
        scatter(xcoordinates(i),ycoordinates(i),'.c')
        hold on;
    elseif(widebeamindex(i)==4)
        s1 = scatter(xcoordinates(i),ycoordinates(i),'.');
        s1.MarkerEdgeColor = [0.9,0.45,0.3];
        hold on;
    elseif(widebeamindex(i)==5)
        scatter(xcoordinates(i),ycoordinates(i),'.y')
        hold on;
    elseif(widebeamindex(i)==6)
        scatter(xcoordinates(i),ycoordinates(i),'.m')
        hold on;
    elseif(widebeamindex(i)==7)
        scatter(xcoordinates(i),ycoordinates(i),'.g')
        hold on;
    elseif(widebeamindex(i)==8)
        s1 = scatter(xcoordinates(i),ycoordinates(i),'.r');
        
        hold on;
    elseif(widebeamindex(i)==9)
        s2 = scatter(xcoordinates(i),ycoordinates(i),'.');
        s2.MarkerEdgeColor = [0.6,0.2,0.8];
        hold on;
    elseif(widebeamindex(i)==10)
        s3 = scatter(xcoordinates(i),ycoordinates(i),'.');
        s3.MarkerEdgeColor = [0.6,0.2,0.9];
        hold on;
    elseif(widebeamindex(i)==11)
        s4 = scatter(xcoordinates(i),ycoordinates(i),'.');
